import React from 'react'

export default function Vehicle(props) {
    if (props.data !== undefined) {
        return (
            <div>
                <div className="vehicle__info-container">
                <h3>Year:</h3><p>{props.data.year}</p>
            </div>
            </div>
        )
    }
}
